    $bleu: #09021e;
    $cyan: #4cc9f0;
    $magenta: #f72585;

    * {
        box-sizing: border-box;
        // cursor: none !important;
        cursor: auto;
        user-select: none;
    }

    body {
        margin: 0;
        padding: 0;
        width: 100%;
        background: $bleu;
        overflow: hidden;
    }

    canvas {
        display: block;
        position: absolute;
        height: 100vh;
        width: 100vw;
        z-index: -1;
        opacity: 1;
        top: 0;
        left: 0;

        &.hologramActive {
            transition: mix-blend-mode 2s cubic-bezier(.25, 0, 0, 1);
            //animation: blinkCanvas 6s infinite;
        }

        &.hologramDefault {
            transition: mix-blend-mode 2s cubic-bezier(.25, 0, 0, 1);
            //mix-blend-mode: normal;
            //opacity: 1;
            // animation: none;
        }

        @keyframes blinkCanvas {
            30% {
                opacity: 1;
            }

            32% {
                opacity: .7;
            }

            33% {
                opacity: 1;
            }

            35% {
                opacity: .7;
            }

            40% {
                opacity: 1;
            }

            80% {
                opacity: .7;
            }

            82% {
                opacity: 1;
            }

            85% {
                opacity: .8;
            }

            87% {
                opacity: 1;
            }
        }
    }

    ////CURSOR CUSTOM///
    @media screen and (max-width: 1024px) {
        .cursor {
            display: none;
        }

        .cursor-shape_out {
            display: none;
        }

        .cursor-shape_out.mouseover {
            display: none;
        }
    }

    .cursor {
        position: fixed;
        pointer-events: none;
        z-index: 100;
        mix-blend-mode: difference;
    }

    .cursor-shape_in {
        position: absolute;
        pointer-events: none;
        border-radius: 50px;
        left: -10px;
        top: -10px;
        width: 20px;
        height: 20px;
        background: $cyan;
        transition: opacity .75s cubic-bezier(.25, 0, 0, 1);

        &.mouseover {
            transition: opacity .5s cubic-bezier(.25, 0, 0, 1);
            opacity: 0;
        }
    }

    .indicClickOnPlane {
        opacity: 0;
        z-index: 100;
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-38%, 15%);
        color: $cyan;
        pointer-events: none;
        font-family: littleTitle;
        font-size: 11px;
        font-weight: bold;
        transition: filter .5s cubic-bezier(.75, 0, 0, 1);
        filter: blur(5px);

        &.planeHover {
            letter-spacing: 1.5px;
            transition: filter .5s cubic-bezier(.75, 0, 0, 1);
            filter: blur(0px);
        }
    }

    .cursor-shape_out {
        mix-blend-mode: difference;
        z-index: 99;
        position: absolute;
        pointer-events: none;
        border-radius: 50px;
        left: 0;
        top: 0;
        width: 50px;
        height: 50px;
        border: $cyan solid 1px;
        transition: padding .75s cubic-bezier(.25, 0, 0, 1);
        // animation: blinkTitle 8s infinite ease-in-out alternate;
    }

