    .title, .littleTitle {
        width: 50vw;
        animation: blinkTitle 8s infinite ease-in-out alternate;
    }

    .littleTitle {
        z-index: 3;
        width: 7vw;
        position: absolute;
        right: 2vw;
        top: 2.2vh;
    }

    .title, .littleTitle {

        path,
        line {
            fill: none;
            stroke: #4CC9F0;
            stroke-width: 0.5;
            stroke-miterlimit: 10;
            stroke-dashoffset: -1000;
            stroke-dasharray: 1000;
        }
    }

    .pathTitleIn {
        animation: titleIn 8s forwards ease-in-out;
    }

    .pathLineIn {
        animation: lineIn 6.5s forwards ease-in-out;
    }

    .pathTitleOut {
        animation: titleOut 8s forwards ease-in-out;
    }

    .pathLineOut {
        animation: lineOut 6.5s forwards ease-in-out;
    }

    @keyframes titleIn {
        0% {
            stroke-dashoffset: -1000;
        }

        40% {
            stroke-dashoffset: 0;
            fill: transparent;
        }

        45% {
            fill: $cyan;
        }

        70% {
            fill: $cyan;
        }

        100% {
            fill: $cyan;
            stroke-dashoffset: 0;
        }
    }

    @keyframes titleOut {
        0% {
            stroke-dashoffset: 0;
            fill: $cyan;
        }

        10% {
            fill: transparent;
        }

        80% {
            stroke-dashoffset: -1000;
            fill: transparent;
        }

        85% {
            fill: transparent;
        }

        100% {
            fill: transparent;
            stroke-dashoffset: -1000;
        }
    }

    @keyframes lineIn {
        0% {
            stroke-dashoffset: -1000;
            stroke-width: 0.5px;
        }

        40% {
            stroke-dashoffset: 0;
            fill: transparent;
            stroke-width: 0.5px;
        }

        45% {
            fill: transparent;
            stroke-width: 0.5px;
        }

        70% {
            stroke-width: 4px;
            stroke-dashoffset: 0;
        }

        100% {
            stroke-width: 4px;
            stroke-dashoffset: 0;
        }
    }

    @keyframes lineOut {
        0% {
            stroke-dashoffset: 0;
            stroke-width: 4px;
        }

        10% {
            stroke-width: 0.5px;
        }

        80% {
            stroke-dashoffset: -1000;
            stroke-width: 0.5px;
        }

        85% {
            stroke-width: 0.5px;
        }

        100% {
            stroke-width: 0.5px;
            stroke-dashoffset: -1000;
        }
    }

    @keyframes blinkTitle {
        0% {
            opacity: 1;
            filter: drop-shadow(0 0 1.5px $cyan);
        }

        20% {
            opacity: 1;
            filter: drop-shadow(0 0 3px $cyan);
        }

        40% {
            opacity: 1;
            filter: drop-shadow(0 0 1.5px $cyan);
        }

        60% {
            opacity: 1;
            filter: drop-shadow(0 0 3px $cyan);
        }

        80% {
            opacity: 1;
            filter: drop-shadow(0 0 1.5px $cyan);
        }

        100% {
            opacity: 1;
            filter: drop-shadow(0 0 3px $cyan);
        }
    }

