        }

        @keyframes blink {
            30% {
                opacity: 1;
                text-shadow: 0 0 0 $cyan, 0 0 2px $cyan, 0 0 2px $cyan;
            }

            32% {
                opacity: .25;
            }

            33% {
                opacity: 1;
            }

            35% {
                opacity: .25;
            }

            40% {
                opacity: 1;
            }
        }

        @keyframes blinkBtn {
            30% {
                opacity: 1;
                text-shadow: 0 0 0 $bleu, 0 0 1px $bleu, 0 0 1px $bleu;
            }

            32% {
                opacity: .65;
            }

            33% {
                opacity: 1;
            }

            35% {
                opacity: .65;
            }

            40% {
                opacity: 1;
                text-shadow: 0 0 0 $bleu, 0 0 1px $bleu, 0 0 1px $bleu;
            }
        }

        @keyframes inSM {
            to {
                transform: translateX(0);
            }
        }

        @keyframes outSM {
            to {
                transform: translateX(175%);
            }
        }

        @keyframes outImpairSM {
            to {
                transform: translateX(-175%);
            }
        }

        &__1 {
            bottom: 1.8%;

            @media screen and (max-width: 600px) {
                bottom: .5%;
            }

            &.mouseover::after {
                content: "FB";
                position: absolute;
                animation: outSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseover::before {
                content: "FB";
                position: absolute;
                transform: translateX(-175%);
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseout::after {
                content: "FB";
                position: absolute;
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(-175%);
            }

            &.mouseout::before {
                content: "FB";
                position: absolute;
                animation: outSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(0);
            }
        }

        &__2 {
            bottom: 6.2%;

            @media screen and (max-width: 600px) {
                bottom: 5.5%;
            }

            &.mouseover::after {
                content: "IG";
                position: absolute;
                animation: outImpairSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseover::before {
                content: "IG";
                position: absolute;
                transform: translateX(175%);
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseout::after {
                content: "IG";
                position: absolute;
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(175%);
            }

            &.mouseout::before {
                content: "IG";
                position: absolute;
                animation: outImpairSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(0);
            }
        }

        &__3 {
            bottom: 10.6%;

            @media screen and (max-width: 600px) {
                bottom: 10.5%;
            }

            &.mouseover::after {
                content: "IN";
                position: absolute;
                animation: outSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseover::before {
                content: "IN";
                position: absolute;
                transform: translateX(-175%);
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseout::after {
                content: "IN";
                position: absolute;
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
