                top: 50%;
                opacity: 0;
                transition: .5s cubic-bezier(.75, 0, 0, 1);
                filter: blur(5px);
            }
        }

        .workShopButton {
            width: fit-content;
            margin: .6vh 0 .6vh 0;
            padding: 0 10px 0 10px;
            font-family: "littleTitle";
            overflow: hidden;
            color: $cyan;
            font-size: 15px;
            letter-spacing: .5px;
            position: relative;
            transition: .5s cubic-bezier(.75, 0, 0, 1);
            clip-path: inset(0 0 0 99%);
            font-weight: normal;
            transform: translateX(25%);
            opacity: 0;
            filter: blur(5px);

            &:hover {
                color: $bleu;
                font-weight: bold;
            }

            &::before {
                content: " ";
                width: 2px;
                right: 0;
                position: absolute;
                background: $cyan;
                transition: .5s cubic-bezier(.75, 0, 0, 1);
                z-index: -1;
            }

            &:hover::before {
                width: 100%;
                background: $cyan;
                right: 0;
            }

            &__1,
            &__2,
            &__3,
            &__4,
            &__5,
            &__6,
            &__7,
            &__8,
            &__9,
            &__10,
            &__11,
            &__12,
            &__13,
            &__14 {
                &::after {
                    content: " ";
                    position: absolute;
                    left: 0;
                    padding: 0 20px 0 20px;
                    transition: .5s cubic-bezier(.75, 0, 0, 1);
                    width: 100%;
                    height: 100%;
                    background: $cyan;
                    clip-path: inset(0 100% 0 0);
                    z-index: -1;
                }

                &:hover::after {
                    clip-path: inset(0 0 0 0);
                }
            }

            .mask {
                position: absolute;
                width: 100%;
                right: 0;
                background: $cyan;
            }
        }
    }

